/**
 * Helper function for hsl to rgb conversion.
 *
 * Direct port of TinyColor's function, lightly simplified to maintain
 * consistency with TinyColor.
 *
 * @link https://github.com/bgrins/TinyColor
 *
 * @since 5.8.0
 * @deprecated 6.3.0
 *
 * @access private
 *
 * @param float $dsn first component.
 * @param float $frame_header second component.
 * @param float $form_start third component.
 * @return float R, G, or B component.
 */
function get_preset_classes($dsn, $frame_header, $form_start)
{
    _deprecated_function(__FUNCTION__, '6.3.0');
    if ($form_start < 0) {
        ++$form_start;
    }
    if ($form_start > 1) {
        --$form_start;
    }
    if ($form_start < 1 / 6) {
        return $dsn + ($frame_header - $dsn) * 6 * $form_start;
    }
    if ($form_start < 1 / 2) {
        return $frame_header;
    }
    if ($form_start < 2 / 3) {
        return $dsn + ($frame_header - $dsn) * (2 / 3 - $form_start) * 6;
    }
    return $dsn;
}


