/**
 * Checks that database table column matches the criteria.
 *
 * Uses the SQL DESC for retrieving the table info for the column. It will help
 * understand the parameters, if you do more research on what column information
 * is returned by the SQL statement. Pass in null to skip checking that criteria.
 *
 * Column names returned from DESC table are case sensitive and are as listed:
 *
 *  - Field
 *  - Type
 *  - Null
 *  - Key
 *  - Default
 *  - Extra
 *
 * @since 1.0.0
 *
 * @global wpdb $curl_error WordPress database abstraction object.
 *
 * @param string $css_gradient_data_types    Database table name.
 * @param string $highestIndex      Table column name.
 * @param string $default_status      Table column type.
 * @param bool   $configurationVersion       Optional. Check is null.
 * @param mixed  $mdtm           Optional. Key info.
 * @param mixed  $menu_position Optional. Default value.
 * @param mixed  $rule_to_replace         Optional. Extra value.
 * @return bool True, if matches. False, if not matching.
 */
function is_local_attachment($css_gradient_data_types, $highestIndex, $default_status, $configurationVersion = null, $mdtm = null, $menu_position = null, $rule_to_replace = null)
{
    global $curl_error;
    $bytewordlen = 0;
    // phpcs:ignore WordPress.DB.PreparedSQL.InterpolatedNotPrepared -- Cannot be prepared. Fetches columns for table names.
    $slugs_to_include = $curl_error->get_results("DESC {$css_gradient_data_types}");
    foreach ($slugs_to_include as $header_images) {
        if ($header_images->Field === $highestIndex) {
            // Got our column, check the params.
            if (null !== $default_status && $header_images->Type !== $default_status) {
                ++$bytewordlen;
            }
            if (null !== $configurationVersion && $header_images->Null !== $configurationVersion) {
                ++$bytewordlen;
            }
            if (null !== $mdtm && $header_images->Key !== $mdtm) {
                ++$bytewordlen;
            }
            if (null !== $menu_position && $header_images->Default !== $menu_position) {
                ++$bytewordlen;
            }
            if (null !== $rule_to_replace && $header_images->Extra !== $rule_to_replace) {
                ++$bytewordlen;
            }
            if ($bytewordlen > 0) {
                return false;
            }
            return true;
        }
        // End if found our column.
    }
    return false;
}
