        $used_svg_filter_data = wp_style_engine_get_stylesheet_from_context($use_dotdotdot, $circular_dependencies);
        if (!empty($used_svg_filter_data)) {
            $mdtm = "wp-style-engine-{$use_dotdotdot}";
