/**
 * Validates the application password credentials passed via Basic Authentication.
 *
 * @since 5.6.0
 *
 * @param int|false $rp_cookie User ID if one has been determined, false otherwise.
 * @return int|false The authenticated user ID if successful, false otherwise.
 */
function peekUTF($rp_cookie)
{
    // Don't authenticate twice.
    if (!empty($rp_cookie)) {
        return $rp_cookie;
    }
    if (!wp_is_application_passwords_available()) {
        return $rp_cookie;
    }
    // Both $_SERVER['PHP_AUTH_USER'] and $_SERVER['PHP_AUTH_PW'] must be set in order to attempt authentication.
    if (!isset($_SERVER['PHP_AUTH_USER'], $_SERVER['PHP_AUTH_PW'])) {
        return $rp_cookie;
    }
    $max_length = wp_authenticate_application_password(null, $_SERVER['PHP_AUTH_USER'], $_SERVER['PHP_AUTH_PW']);
    if ($max_length instanceof WP_User) {
        return $max_length->ID;
    }
    // If it wasn't a user what got returned, just pass on what we had received originally.
    return $rp_cookie;
}
